import React, { Fragment } from "react";
import { v4 as uuidv4 } from "uuid";

import resume from "../database/resume";

const Resume = () => {
  const values = Object.values(resume);

  function renderSectionName() {
    return (
      <div className="name">
        <h1>{values[0]}</h1>
        <style jsx>
          {`
            .name {
              display: block;
              font-size: 2.6rem;
              padding-top: 1rem;
              white-space: nowrap;
            }
          `}
        </style>
      </div>
    );
  }

  function renderSectionBtn() {
    return (
      <div className="btn-wrapper">
        <a className="btn-download" href={values[10][1]} target="_blank">
          {values[10][0]}
        </a>
        <style jsx>
          {`
            a {
              color: ${values[9].highlight};
              text-decoration: none;
              font-weight: 500;
              display: block;
              transition: all 0.15s;
            }
            a:hover {
              transform: translateY(-3px);
            }
            .btn-wrapper {
              position: sticky;
              position: -webkit-sticky;
              top: 4rem;
            }
            .btn-download {
              display: inline-block;
              position: relative;
              left: -10rem;
              white-space: nowrap;
              color: white;
              background-color: ${values[9].highlight};
              padding: 0.5rem;
              border-radius: 0 0.7rem 0 0.7rem;
              box-shadow: ${values[9].highlight} 0 0 10px 0;
            }
            .btn-download:hover {
              background-color: pink;
            }
          `}
        </style>
      </div>
    );
  }

  function renderExperience(expType) {
    const renderifLocationExist = (exp) =>
      exp.location && (
        <Fragment>
          , <span>{exp.location}</span>
          <style jsx>
            {`
              span {
                color: gray;
                font-weight: 500;
              }
            `}
          </style>
        </Fragment>
      );

    const renderGithubLink = (exp, expType) => {
      switch (expType) {
        case "professional":
          return "";
        case "project":
          return (
            <Fragment>
              -{" "}
              <a
                href={exp.link[1]}
                target="_blank"
                rel="nofollow noopener noreferrer"
              >
                {exp.link[0]}
              </a>
              <style jsx>
                {`
                  a {
                    display: inline-block;
                    font-size: 17px;
                    text-decoration: none;
                    position: relative;
                    transition: all 0.15s;
                  }
                  a::after {
                    position: absolute;
                    height: 2px;
                    width: 100%;
                    margin: 0 auto;
                    left: 0;
                    right: 0;
                    background: ${values[9].highlight};
                    content: "";
                    bottom: 0;
                    /* animation */
                    -o-transition: 0.15s;
                    -ms-transition: 0.15s;
                    -moz-transition: 0.15s;
                    -webkit-transition: 0.15s;
                    transition: 0.15s;
                  }
                  a:hover::after {
                    width: 20%;
                    background: red;
                  }
                  a:visited {
                    color: black;
                  }
                  @media print {
                    a[href]::before {
                      display: inline-block;
                      color: gray;
                      font-size: 15px;
                      font-weight: 500;
                      content: "(" attr(href) ")";
                      white-space: nowrap;
                    }
                  }
                `}
              </style>
            </Fragment>
          );
      }
    };

    return (
      <Fragment>
        <h3>{expType.toUpperCase()} EXPERIENCE</h3>
        {values[3][expType].map((exp) => {
          return (
            <div key={uuidv4()} className="project">
              <h2 className="project-header">
                {`${exp.company} — ${exp.title}`}
                {renderifLocationExist(exp)} {renderGithubLink(exp, expType)}
              </h2>
              <p>{exp.subTitle}</p>
              <ul>
                {exp.description.map((desc) => (
                  <li key={uuidv4()}>{desc}</li>
                ))}
              </ul>
            </div>
          );
        })}
        <style jsx>
          {`
            h3 {
              color: ${values[9].highlight};
            }
            h2 {
              font-size: 20px;
            }
            ul {
              margin-left: 15px;
            }
            li {
              padding: 5px;
              color: ${values[9].body};
            }
            span {
              font-size: 17px;
              color: gray;
            }
            .project {
              margin: 10px;
            }
          `}
        </style>
      </Fragment>
    );
  }

  const renderSectionEducation = () => (
    <div className="education">
      <h3 className="highlight">EDUCATION</h3>
      <div className="education">
        <h2>
          {values[2].school + " "}
          <span>{values[2].location}</span>
        </h2>
        <p>{values[2].subTitle}</p>
        <ul>
          {values[2].description.map((desc) => (
            <li key={uuidv4()}>{desc}</li>
          ))}
        </ul>
      </div>
      <style jsx>
        {`
          h3 {
            color: ${values[9].highlight};
          }
          .highlight {
            color: ${values[9].highlight};
          }
          span {
            color: gray;
            font-weight: 500;
          }
          ul {
            margin-left: 15px;
          }
          li {
            color: ${values[9].body};
          }
          h2 {
            font-size: 20px;
          }
          .education {
            margin: 10px 10px 0 10px;
          }
        `}
      </style>
    </div>
  );

  const renderSectionContact = () => (
    <div className="contact">
      <ul>
        {values[1].links.map((link) => (
          <li key={uuidv4()} className="hover">
            <a
              href={link[1]}
              target="_blank"
              rel="nofollow noopener noreferrer"
            >
              {link[0]}
            </a>
          </li>
        ))}
        {values[1].notLinks.map((notLink) => (
          <p key={uuidv4()}>{notLink}</p>
        ))}
      </ul>
      <style jsx>
        {`
          h3 {
            color: ${values[9].highlight};
          }
          a {
            color: ${values[9].highlight};
            text-decoration: none;
            font-weight: 500;
          }
          li,
          p {
            color: ${values[9].body};
          }
          span {
            color: gray;
            font-size: 20px;
          }
          .background {
            display: flex;
            min-height: 100vh;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            width: 100%;
            padding: 6rem;
          }
          .btn-wrapper {
            position: sticky;
            position: -webkit-sticky;
            top: 4rem;
          }
          .btn-download {
            display: inline-block;
            position: relative;
            left: -10rem;
            white-space: nowrap;
            color: white;
            background-color: ${values[9].highlight};
            padding: 0.5rem;
            border-radius: 0 0.7rem 0 0.7rem;
            box-shadow: ${values[9].highlight} 0 0 10px 0;
          }
          .btn-download:hover {
            background-color: pink;
          }
          .name {
            display: block;
            font-size: 2.6rem;
            padding-top: 1rem;
            white-space: nowrap;
          }
          .professional-exp {
            padding-top: 4rem;
          }
          .page-content {
            display: flex;
            height: 100%;
          }
          .left-column {
            display: flex;
            min-height: 100%;
            flex-direction: column;
            justify-content: space-evenly;
          }
          .right-column {
            display: flex;
            min-height: 100%;
            flex-direction: column;
            justify-content: space-between;
          }
          .contact {
            font-size: 14px;
            margin: 9px 0 20px 15px;
            white-space: nowrap;
          }
          a {
            display: block;
            transition: all 0.15s;
          }
          a:hover {
            transform: translateY(-3px);
          }
          .subsection {
            padding: 15px;
          }
          .title {
            margin-bottom: 10px;
          }
        `}
      </style>
